import React from 'react'
import Banner from '../components/Banner'

const Homepage = () => {
  return (
    <section className='max-container px-5'>
      <Banner />
      <div>
        <p className='font-bold text-xs'>Categories</p>
      </div>
    </section>
  )
}

export default Homepage
